using bimU.io.Client.Core.Messages;
using bimU.io.Client.Core.Plugin;
using Newtonsoft.Json;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Text;
using System.Threading.Tasks;
using System.Windows.Threading;
using Tekla.Structures;
using Tekla.Structures.Geometry3d;
using Tekla.Structures.Model;
using Tekla.Structures.Model.UI;
using TSM = Tekla.Structures.Model;
using TSMUI = Tekla.Structures.Model.UI;

namespace MyTeklaPlugin
{
    public class MyTeklaPlugin : IPlugin
    {
        private static Random random = new Random();
        private static List<AuthoringToolClient> supportedClients = new List<AuthoringToolClient>() { AuthoringToolClient.Tekla2021_0 };
        public IEnumerable<AuthoringToolClient> getSupportedClients()
        {
            Console.WriteLine($"Number of supported clients: {supportedClients.Count}");
            Console.WriteLine($"{supportedClients[0].ToString()}");
            
            return supportedClients;
        }

        public string importIssues(object[] context, string configs)
        {
            TSM.Model model = (TSM.Model)context[0];
            TSMUI.ModelObjectSelector mos = (TSMUI.ModelObjectSelector)context[1]; // This is accessible through TSM.Model too
            TSMUI.ModelViewEnumerator visibleViews = (TSMUI.ModelViewEnumerator)context[2];
            Dispatcher teklaDispatcher = (Dispatcher)context[3];
            TeklaHelper teklaHelper = new TeklaHelper(model, visibleViews, teklaDispatcher);
            List<ColumnDesign> columnDesignData = teklaHelper.GetColumnDesignData();

            var issues = new List<CustomIssue>();
            foreach(var columnDesign in columnDesignData)
            {
                CustomIssue issue = new CustomIssue()
                {
                    //reserved fields
                    title = $"{columnDesign.Story}-{columnDesign.Position}-{columnDesign.Name}",
                    description = $"{model.GetInfo().ModelPath}",
                    viewpoint = columnDesign.viewpoint,//new bimU.io.Client.Core.DataModels.Viewpoint(),
                    snapshot = columnDesign.snapshot, // "",
                    //custom fields
                    position = $"{columnDesign.Story}-{columnDesign.Position}",
                    sizeX = columnDesign.SizeX,
                    numberX = columnDesign.NumberX,
                    sizeY = columnDesign.SizeY,
                    numberY = columnDesign.NumberY,
                    sizeCorner = columnDesign.SizeCorner,
                    sizeStirrupConfined = $"{columnDesign.SizeStirrupConfined}@{columnDesign.SpacingStirrupJoint}mm",
                    sizeStirrupMiddle = $"{columnDesign.SizeStirrupMiddle}@{columnDesign.SpacingStirrupMiddle}mm",
                    sizeTieX = columnDesign.SizeTieX,
                    numberTieX = columnDesign.NumberTieX,
                    sizeTieY = columnDesign.SizeTieY,
                    numberTieY = columnDesign.NumberTieY,
                    cover = $"{columnDesign.Cover}mm"
                };
                issues.Add(issue);
            }

            return JsonConvert.SerializeObject(issues);
        }

        public string onIssueCreating(object[] context, string configs)
        {
            return createCustomIssueFields(context).ToString();
        }

        public string onIssueUpdating(object[] context, string configs)
        {
            return createCustomIssueFields(context).ToString();
        }

        private CustomIssue createCustomIssueFields(object[] context)
        {
            TSM.Model model = (TSM.Model)context[0];
            TSMUI.ModelObjectSelector mos = (TSMUI.ModelObjectSelector)context[1]; // This is accessible through TSM.Model too
            TSMUI.ModelViewEnumerator visibleViews = (TSMUI.ModelViewEnumerator)context[2];
            CustomIssue issue = new CustomIssue()
            {
                title = generateRandomString(random.Next(25)),
                description = model.GetInfo().ModelName,
                viewpoint = new bimU.io.Client.Core.DataModels.Viewpoint(),
                snapshot = "",
            };
            return issue;
        }

        private static string generateRandomString(int length)
        {
            const string chars = "ABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789 ";
            return new string(Enumerable.Repeat(chars, length)
                .Select(s => s[random.Next(s.Length)]).ToArray());
        }
    }
}
